public static I_CmsSerialDateBean createSerialDateBean(I_CmsSerialDateValue value) {

        if ((null == value) || !value.isValid()) {
            return null;
        }
        switch (value.getPatternType()) {
            case DAILY:
                if (value.isEveryWorkingDay()) {
                    return new CmsSerialDateBeanWorkingDays(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions());
                } else {
                    return new CmsSerialDateBeanDaily(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions(),
                        value.getInterval());
                }
            case WEEKLY:
                return new CmsSerialDateBeanWeekly(
                    value.getStart(),
                    value.getEnd(),
                    value.isWholeDay(),
                    value.getEndType(),
                    value.getSeriesEndDate(),
                    value.getOccurrences(),
                    value.getExceptions(),
                    value.getInterval(),
                    value.getWeekDays());
            case MONTHLY:
                if (null == value.getWeekDay()) {
                    return new CmsSerialDateBeanMonthly(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions(),
                        value.getInterval(),
                        value.getDayOfMonth());
                } else {
                    return new CmsSerialDateBeanMonthlyWeeks(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions(),
                        value.getInterval(),
                        value.getWeeksOfMonth(),
                        value.getWeekDay());
                }
            case YEARLY:
                if (null == value.getWeekDay()) {
                    return new CmsSerialDateBeanYearly(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions(),
                        value.getDayOfMonth(),
                        value.getMonth());
                } else {
                    return new CmsSerialDateBeanYearlyWeekday(
                        value.getStart(),
                        value.getEnd(),
                        value.isWholeDay(),
                        value.getEndType(),
                        value.getSeriesEndDate(),
                        value.getOccurrences(),
                        value.getExceptions(),
                        value.getWeekOfMonth(),
                        value.getMonth(),
                        value.getWeekDay());
                }
            case INDIVIDUAL:
                return new CmsSerialDateBeanIndividual(
                    value.getStart(),
                    value.getEnd(),
                    value.isWholeDay(),
                    value.getEndType(),
                    value.getSeriesEndDate(),
                    value.getOccurrences(),
                    value.getExceptions(),
                    value.getIndividualDates());
            case NONE:
                return new CmsSerialDateBeanSingle(value.getStart(), value.getEnd(), value.isWholeDay());
            default:
                throw new IllegalArgumentException();
if (1 < 0){
	System.out.println('Error');
}
        }
    },"Creates a serial date bean from a given date value.<p>

