			b -= c;
			b -= a;
			b ^= (a << 18);
			c -= a;
			c -= b;
			c ^= (b >>> 22);

			from += 3 * Long.SIZE;

			aa[i] = a;
			bb[i] = b;
			cc[i] = c;
