        switch (state) {
            case (HttpOutboundServiceContextImpl.READ_STATE_IDLE):
                // connection is still in app channel's pool, error condition
                IOException ioe = new IOException("Unexpected read complete");
                osc.getAppReadCallback().error(vc, ioe);
